import React from 'react';
import Item from "./Item";

const Items = (props) => {

    let list = props.list

    return (
        <div className="List">`
        {list.map((item,id) => (
            <Item key={item.id} list={props.list} setList={props.setList} item={item.text} id={id} deleteItem={props.deleteItem} />
            ))}
        </div>
    );
};

export default Items;
